class Solution:

    
    def get_pairs(self):
        all_pair=[]
        tot_nums = len(self.nums)
        i=1
        for first in self.nums:#first pair element
            for s in range(i,tot_nums):#second element
                all_pair.append([first,self.nums[s]])
            i+=1
        return all_pair
    
    def get_abs_val(self,lis):
        #given the list it returns back the list with absolute difference between the pairs
        abs_val =[]
        for l in lis:
            diff = l[1]-l[0]
            if diff<0:
                #-ve value
                diff = diff*-1
            abs_val.append(diff)
        return abs_val



    def smallestDistancePair(self, nums: list[int], k: int) -> int:
        self.nums =nums
        all_pairs = self.get_pairs()#get all possible pair
        abs_val = (self.get_abs_val(all_pairs)) #gets the list of  abs difference between each pair 
        abs_val=sorted(abs_val)
        # print(abs_val)
        if k<= len(abs_val):
            # print("target pair",sorted_all_pairs[k-1])
            return abs_val[k-1]#self.get_abs_val(sorted_all_pairs[k-1])
        return 0


